import React from "react";
import { Route, Routes } from "react-router-dom";

import "./App.css";
import PlanetPage from "./pages/PlanetPage";

function App() {
  return (
    <React.Fragment>
      <div className="main-div">
        <div className="container-div">
      <Routes>
        <Route path='/planets' element={<PlanetPage/>} />
      </Routes>
      </div>
        <PlanetPage />
        </div>
    </React.Fragment>
  );
}

export default App;
